import React from "react";
import "./App.css";
import { Link } from "react-router-dom";
import Navbar from "react-bootstrap/Navbar";
import Container from "react-bootstrap/Container";
import Breadcrumb from "react-bootstrap/Breadcrumb";
import Button from "react-bootstrap/Button";

const handleRedirect = () => {
  const buttonValue = document.getElementsByClassName(".btn btn-info").value;
  if (buttonValue == "usuario") {
    console.log(buttonValue);
  } else if (buttonValue == "veiculo") {
    console.log(buttonValue);
  } else {
    console.log(buttonValue);
  }
};

function App() {
  return (
    <div className="App">
      <header>
        <div>
          <Navbar bg="dark" variant="dark">
            <Container>
              <Navbar.Brand href="#home">ParkSys</Navbar.Brand>
            </Container>
            <Button variant="info" value="usuario" onClick={handleRedirect()}>
              Usuários
            </Button>
            <Button variant="info" value="veiculo" onClick={handleRedirect()}>
              Veículos
            </Button>
            <Button variant="info" value="buscar" onClick={handleRedirect()}>
              Buscar
            </Button>
          </Navbar>
        </div>
      </header>
      <main>
        <div></div>
      </main>
    </div>
  );
}

export default App;
